</div>
<p>Data: 28.04.2019 ( niedziela ) godzina: 15.00 Miejsce: Powiatowy Zespol Szkol nr 4 &#8222;Samochodowka&#8221; ul. Sobieskiego 344 W najblizsza niedziele zolto - czerwoni po raz ostatni w tym sezonie wybiegna na ligowy parkiet. Przeciwnikiem ich bedzie druzyna AZS Bydgoszcz. Tytani, fotel wicelidera, zapewnili sobie juz nieco wczesniej, dlatego wynik tego meczu nie wplynie na miejsce&#8230;</p>
