</div>
<p>&nbsp; Sezon II ligowcow dobiega konca!!! Wejherowianie w ostatnim meczu sezonu podejma u siebie zespol Akademikow z Bydgoszczy. Na wyjezdzie Tytani wygrali zaledwie jedna bramka  30-29 i to zwyciestwo przyszlo w niezwyklych trudach. Czy i tym razem Tytani zwycieza i odprawia Bydgoszcz z zerowym kwitkiem??? Na pewno jest o co walczyc poniewaz szczypiornisci z Grodu&#8230;</p>
